import { initializeApp } from "firebase/app";
import { getAuth, signOut, } from "firebase/auth";
import { useNavigate } from "react-router-dom";
import "./app.css"
function Main() {

    const navigate = useNavigate()

    const firebaseConfig = {
        apiKey: "AIzaSyClEH1wG_p4Bk7y8dl88UEi1OcSmd_7Yl4",
        authDomain: "pro-app-7adb5.firebaseapp.com",
        projectId: "pro-app-7adb5",
        storageBucket: "pro-app-7adb5.appspot.com",
        messagingSenderId: "840528707586",
        appId: "1:840528707586:web:759e54f6d5ecf02251671b",
        measurementId: "G-Q000JTLWD8"
    };

    const app = initializeApp(firebaseConfig);
    const auth = getAuth()
    const submitData = (event) => {
        event.preventDefault()


        signOut(auth)
            .then(() => {
                alert("Logout successfull")
                navigate("/Login")
            })
            .catch(() => {
                alert("error")
            })

    }

    return (




        <div  id="b">
                      <ul style={{ boxShadow: "lightblue 8px 10px 10px 8px", position: "fixed", width: "100%" }}>
                        <li>  <img src="https://cdn-icons-png.flaticon.com/512/146/146940.png" style={{ width: "70px", borderRadius: "20px" }}></img></li>
                         <li  id="mob" style={{ color: "  rgb(0, 255, 89)", fontSize: "larger", opacity: "0.6" }}>  <b>BOOK_STALL</b></li>
                          <li >
                          <form >
                        <input type="search" placeholder="Search" id="search" style={{ width: "600px", padding: "10px",  }}></input>
                        <button class="btn btn-outline-success" type="submit">Search</button>
                    </form>
                          </li>
                           <li style={{ marginTop: "15px" }}>  <p id="bell" style={{ marginLeft: "50px", }}><i style={{ fontSize: "30px", border: "2px solid black", borderRadius: "50% ", padding: "10px", cursor: "pointer" }} class="fa-solid fa-bell"></i></p>
                </li>
                      <li style={{ marginTop: "20px" }}>
                    <form id="log" onSubmit={submitData}>
                        <button type="submit" class="btn btn-danger">Logout</button>
                    </form>
</li>





                      </ul>






        </div>







































    )
}
export default Main;
